import React from 'react';

const TestPage: React.FC = () => {
  return (
    <div style={{ padding: '2rem', textAlign: 'center' }}>
      <h1>Test Sayfası</h1>
      <p>Bu sayfa routing'in çalıştığını test etmek için oluşturuldu.</p>
      <div style={{ marginTop: '2rem' }}>
        <a href="/" style={{ marginRight: '1rem', padding: '0.5rem 1rem', backgroundColor: '#1B263B', color: 'white', textDecoration: 'none', borderRadius: '8px' }}>
          Ana Sayfa
        </a>
        <a href="/nurse" style={{ marginRight: '1rem', padding: '0.5rem 1rem', backgroundColor: '#E63946', color: 'white', textDecoration: 'none', borderRadius: '8px' }}>
          Hemşire Sayfası
        </a>
        <a href="/doctor" style={{ padding: '0.5rem 1rem', backgroundColor: '#06D6A0', color: 'white', textDecoration: 'none', borderRadius: '8px' }}>
          Doktor Sayfası
        </a>
      </div>
    </div>
  );
};

export default TestPage;
